class Solution {
public:
    long long continuousSubarrays(vector<int>& nums) {
        long long count = 0;
        int left = 0; // Start of the window
        int minElem = nums[0], maxElem = nums[0]; // Track min and max within the window

        for (int right = 0; right < nums.size(); ++right) {
            // Update the min and max in the current window
            minElem = min(minElem, nums[right]);
            maxElem = max(maxElem, nums[right]);

            // While the condition breaks, move the left pointer
            while (maxElem - minElem > 2) {
